(387, 'Priol', '$2y$13$YIJ.tMtgfC5VjkeHTyMjaer1.gUSbzpZxNM9yHxqWTlqZGPZc08NW', 'gildas.priol@gmail.com', 'Bonjour, je souhaite diffuser la mémoire des SAS de l\'opération Derry dans le secteur de Brest sur notre site: www.resistance-brest.net Il va de soit que si nous utilisons votre compte, ce sera indiqué dans les sources avec un lien direct vers la page de votre site.', 'ROLE_USER', 'fr', NULL, 1, NULL, '2020-05-14 19:36:49', 'USER', 'David P', '2020-02-27 16:46:44'),
(388, 'LECHAT Jean', '$2y$13$2rh.NYAnoF0aiQk/hrAGrOoNNdYK1f4s4UIFVD1BWPsdey2B7vkZW', 'jean.lechat@free.fr', 'Commémoration 75ème anniv. libération poche sud St-Nazaire 10/05/2020. Recherche les noms des participants aux différents combats effectués par les paras du Cne Fournier. Notamment celle où il fut blessé avec un autre para qui, malheureusement devait mourir en arrivant à l\'hôpital de Nantes. Nous tentons de porter sur \"le chemin de la mémoire\" les noms de tous ces braves que j\'ai côtoyés durant leur séjour en septembre 1944 (j\'avais 9 ans) à VUE en Loire-Atlantique. Je possède une photo d\'un jeune para dédicacée qui s\'appelait Fernand DURAND (', 'ROLE_USER', 'fr', NULL, 1, NULL, '2020-03-02 09:40:06', 'USER', 'David P', '2020-02-27 16:50:08'),
